import './style.css';

export default function Footer() {
    return(
        <div id="footer">
             <div id="contact">
                <h2>Contact</h2>
                <p>Contact information and a contact form can be added here.</p>
            </div>

            <footer>
                <p>&copy; 2023 Your Name</p>
            </footer>
        </div>
    )

}
